import './App.css';
import { Route, Routes } from 'react-router-dom';
import homePage from './pages/homePage';
import ContactInfo from './pages/contactInfo';

export default function App() {
  return (
    <Routes>
      <Route exact path="/" element={<homePage/>} />
    </Routes>
  )
}
